(window.webpackJsonp=window.webpackJsonp||[]).push([[33],{"12fca290f107c15e39dd":function(o,i){o.exports="<h1 id=qladdict>qladdict</h1> <p><a href=https://github.com/tattali/QLAddict/ >QLAddict</a></p> <p>A QuickLook plugin that lets you view subtitles .srt files like Addic7ed.com on mac</p> <p>\u5feb\u901f\u9884\u89c8\u5b57\u5e55\u6587\u4ef6</p> <h1 id=qlcolorcode>qlcolorcode</h1> <p><a href=https://github.com/anthonygelibert/QLColorCode>QLColorCode</a></p> <p>QLColorCode Quick Look plugin for source code with syntax highlighting.</p> <p>\u5e26\u6709\u4ee3\u7801\u9ad8\u4eae\u7684\u4ee3\u7801\u9884\u89c8</p> <h1 id=qldds>qldds</h1> <p><a href=https://github.com/Marginal/QLdds>QuickLook DDS</a></p> <p>This package allows OSX Finder to display thumbnails, previews and metadata for &quot;DirectDraw Surface&quot; (DDS) texture files.</p> <p>\u5feb\u901f\u9884\u89c8DDS\u6587\u4ef6\uff0cDirectDraw Surface - \u5927\u7ea6\u662f\u5fae\u8f6f\u7684DriectX\u7684\u4e1c\u897f</p> <h1 id=qlgradle>qlgradle</h1> <p><a href=https://github.com/Urucas/QLGradle>qlgradle</a></p> <p>Quicklook plugin for .gradle files</p> <p>Gradle\u662f\u4e00\u4e2a\u57fa\u4e8eApache Ant\u548cApache Maven\u6982\u5ff5\u7684\u9879\u76ee\u81ea\u52a8\u5316\u6784\u5efa\u5de5\u5177\u3002\u5b83\u4f7f\u7528\u4e00\u79cd\u57fa\u4e8eGroovy\u7684\u7279\u5b9a\u9886\u57df\u8bed\u8a00(DSL)\u6765\u58f0\u660e\u9879\u76ee\u8bbe\u7f6e\uff0c\u629b\u5f03\u4e86\u57fa\u4e8eXML\u7684\u5404\u79cd\u7e41\u7410\u914d\u7f6e\u3002</p> <h1 id=qlimagesize>qlimagesize</h1> <p><a href=https://github.com/Nyx0uf/qlImageSize>qlImageSize</a></p> <p>QuickLook plugin to display the dimensions and size of an image in the title bar instead of the filename. Also preview some unsupported formats like WebP &amp; bpg.</p> <p>\u5728\u5feb\u901f\u9884\u89c8\u53ef\u4ee5\u663e\u793a\u56fe\u7247\u5927\u5c0f\uff0c\u5e76\u4e14\u63d0\u4f9b\u9884\u89c8\u4e0d\u652f\u6301\u7684\u56fe\u7247\u5982webp\u7b49</p> <h1 id=qlmarkdown>qlmarkdown</h1> <p><a href=https://github.com/toland/qlmarkdown>QLMarkdown</a></p> <p>QuickLook generator for Markdown files</p> <p>markdown\u9884\u89c8</p> <h1 id=qlmobi>qlmobi</h1> <p><a href=https://github.com/bfabiszewski/QLMobi>QLMobi</a></p> <p>Quick Look plugin for Kindle ebook formats</p> <p>kindle\u7535\u5b50\u4e66\u7684\u5feb\u901f\u9884\u89c8</p> <h1 id=qlnetcdf>qlnetcdf</h1> <p><a href=https://github.com/tobeycarman/QLNetcdf/ >QLNetcdf</a></p> <p>A QuickLook Plugin for previewing NetCDF files.</p> <p><a href=http://www.unidata.ucar.edu/software/netcdf/ >Network Common Data Form (NetCDF)</a></p> <ul> <li>NetCDF is a set of software libraries and self-describing, machine-independent data formats that support the creation, access, and sharing of array-oriented scientific data.</li> </ul> <h1 id=qlplayground>qlplayground</h1> <p><a href=https://github.com/norio-nomura/qlplayground>qlplayground</a></p> <p><code>qlplayground</code> is a QuickLook plugin for Swift files.</p> <p>\u5feb\u901f\u9884\u89c8swift\u6587\u4ef6(.swift, .playground)</p> <h1 id=qlprettypatch>qlprettypatch</h1> <p><a href=https://github.com/atnan/QLPrettyPatch>QLPrettyPatch</a></p> <p>QuickLook generator for patch files</p> <p>patch \u6587\u4ef6\u5feb\u901f\u9884\u89c8</p> <h1 id=qlrest>qlrest</h1> <p><a href=https://github.com/cluther/qlrest>QLRest</a></p> <p>QLRest is a simple QuickLook generator for reStructuredText files. It renders a preview of the selected ReST file using Python, Docutils and Pygments.</p> <h1 id=qlstephen>qlstephen</h1> <p><a href=https://whomwah.github.io/qlstephen/ >QLStephen</a></p> <p>A QuickLook plugin that lets you view plain text files without a file extension</p> <p>\u5feb\u901f\u9884\u89c8\u7eaf\u6587\u672c\u6587\u4ef6\uff0c\u5982\uff1a</p> <ul> <li>README</li> <li>INSTALL</li> <li>CHANGELOG</li> <li>Makefile</li> <li>Rakefile</li> <li>CapFile</li> </ul> <h1 id=qlswift>qlswift</h1> <p><a href=https://github.com/lexrus/QLSwift>QLSwift</a></p> <p>A Quick Look plugin for Swift files. Inspired by QLMarkdown.</p> <p>swift \u5feb\u901f\u9884\u89c8 sublime \u7684\u9ed8\u8ba4\u8272\u8c03</p> <h1 id=qlvideo>qlvideo</h1> <p><a href=https://github.com/Marginal/QLVideo>QuickLook Video</a></p> <p>This package allows macOS Finder to display thumbnails, static previews, cover art and metadata for most types of video files.</p> <p>QuickLook and Spotlight on macOS 10.9 and later understand a limited number of media files - mostly only MPEG audio and video codecs within MPEG container files. This package adds support for wide range of other codecs and &quot;non-native&quot; media file types, including .asf, .avi, .flv, .mkv, .rm, .webm, .wmf etc.</p> <p>\u652f\u6301\u66f4\u591a\u683c\u5f0f\u7684\u89c6\u9891\u9884\u89c8</p> <h1 id=emin-webpquicklook>emin-webpquicklook</h1> <p><a href=https://github.com/emin/WebPQuickLook>WebPQuickLook</a></p> <p>Mac OS X QuickLook plugin for WebP image files</p> <h1 id=epubquicklook>epubquicklook</h1> <p><a href=https://github.com/jaketmp/ePub-quicklook>EPUB QuickLook</a></p> <p>The epub.qlgenerator plugin is designed to extract the cover images from EPUB files to use as the file icon, and present a nice overview of the EPUB in QuickLook.</p> <p>The epub.mdimporter plugin is designed to extract information from EPUB files (metadata as well as text content) and index it so that Spotlight can search it.</p> <p>\u5feb\u901f\u9884\u89c8epub \u548c spotlight\uff08mdfind\uff09\u641c\u7d22epub\u5185\u5bb9</p> <h1 id=quicklook-csv>quicklook-csv</h1> <p><a href=https://github.com/p2/quicklook-csv>QuickLookCSV</a></p> <p>Quick look CSV files for Mac OS X 10.5 and newer. Supports files separated by comma (,), tabs (\u21e5), semicolons (;) pipes (|). The plugin will generate Icons and show a preview, along with some information (like num rows/columns). Many thanks to Ted Fischer for valuable input and testing of version 1.1!</p> <p>\u5feb\u901f\u9884\u89c8CSV</p> <h1 id=quicklook-json>quicklook-json</h1> <p><a href=http://www.sagtau.com/quicklookjson.html>quick look JSON</a></p> <p>quick look json is a useful quick look plugin to preview JSON files. It will render files with a colorful view, and will allow to expand or compress nodes in the JSON tree.</p> <p>JSON\u6587\u4ef6\u5feb\u901f\u9884\u89c8</p> <h1 id=quicklook-pat>quicklook-pat</h1> <p><a href=https://github.com/pixelrowdies/quicklook-pat>Adobe Photoshop Patterns Quicklook Plugin</a></p> <p>Quicklook plugin to view Adobe Photoshop pattern files in Apple&#39;s Finder application.</p> <h1 id=quicklook-pfm>quicklook-pfm</h1> <p><a href=https://github.com/lnxbil/quicklook-pfm>quicklook-pfm</a></p> <p>Apple QuickLook Plugin for PPM, PGM, PFM and PBM files</p> <p>This piece of code enables Apple QuickLook to open</p> <ul> <li>PPM (3-channel 8-bit) files</li> <li>PFM (1/3 channel 32-bit ) files</li> <li>PGM (1-channel 8-bit) files</li> <li>PBM (1-channel 1-bit) files</li> </ul> <h1 id=quicklookapk>quicklookapk</h1> <p><a href=https://github.com/hezi/QuickLookAPK>QuickLookAPK</a></p> <p>A Quick Look plugin for Android packages</p> <p>Android APK \u6587\u4ef6\u9884\u89c8</p> <h1 id=quicklookase>quicklookase</h1> <p><a href=https://github.com/rsodre/QuickLookASE>QuickLookASE</a></p> <p>Mac QuickLook for ASE files (Adobe Swatch Exchange)</p> <p>ASE are color palettes that can be exported from Adobe Photoshop, Adobe Illustrator, Adobe Color CC, Spectrum, COLOURlovers, Prisma, among many others.</p> <p>Based on Apple&#39;s QuickLookSketch.</p> <h1 id=receiptquicklook>receiptquicklook</h1> <p><a href=https://github.com/letiemble/ReceiptQuickLook>ReceiptQuickLook</a></p> <p>A QuickLook plugin to inspect App Store receipts.</p> <p>This quick look plugin provides a way to visualize cryptographic receipt generated by the App Stores (iOS and OS X). This is quite useful for iOS application as there is no way to visualize them on the device.</p> <h1 id=ttscoff-mmd-quicklook>ttscoff-mmd-quicklook</h1> <p><a href=https://github.com/ttscoff/mmd-quicklook>MMD-QuickLook</a></p> <p>Improved QuickLook generator for MultiMarkdown files</p> <p>This is a quick fork of Fletcher Penney&#39;s MMD Quicklook project. It adds some styling to the default Quick Look preview (based on GitHub CSS) and allows for customization via a .mdqlstyle.css file in your home folder.</p> "}}]);